// src/pages/LogsPage.jsx
import React, { useState } from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  TableContainer,
  Paper
} from '@mui/material';

function LogsPage() {
  const [searchTerm, setSearchTerm] = useState("");
  const [level, setLevel] = useState("");
  const [date, setDate] = useState("");

  const logs = [
    { id: 1, time: "2025-02-11 09:15", ip: "192.168.1.15", level: "INFO", message: "Bağlantı Sağlandı" },
    { id: 2, time: "2025-02-11 09:17", ip: "10.0.0.25", level: "ERROR", message: "Erişim Reddedildi" }
  ];

  const handleFilter = () => {
    console.log("Filtre Uygula", { searchTerm, level, date });
  };
  const exportCSV = () => {
    console.log("CSV çıktı...");
  };
  const exportPDF = () => {
    console.log("PDF çıktı...");
  };

  return (
    <Box>
      <Typography variant="h5" gutterBottom>
        Log Yönetimi
      </Typography>

      {/* Filtre Alanı */}
      <Box display="flex" gap={2} mb={2} flexWrap="wrap">
        <TextField
          label="Anahtar Kelime"
          variant="outlined"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <FormControl sx={{ width: 120 }}>
          <InputLabel>Seviye</InputLabel>
          <Select
            value={level}
            label="Seviye"
            onChange={(e) => setLevel(e.target.value)}
          >
            <MenuItem value="">Hepsi</MenuItem>
            <MenuItem value="INFO">INFO</MenuItem>
            <MenuItem value="WARN">WARN</MenuItem>
            <MenuItem value="ERROR">ERROR</MenuItem>
          </Select>
        </FormControl>
        <TextField
          type="date"
          label="Tarih"
          InputLabelProps={{ shrink: true }}
          value={date}
          onChange={(e) => setDate(e.target.value)}
        />
        <Button variant="contained" onClick={handleFilter}>
          Filtre Uygula
        </Button>
        <Button variant="outlined" onClick={exportCSV}>CSV Çıkışı</Button>
        <Button variant="outlined" onClick={exportPDF}>PDF Çıkışı</Button>
      </Box>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Tarih/Saat</TableCell>
              <TableCell>Kaynak IP</TableCell>
              <TableCell>Seviye</TableCell>
              <TableCell>Mesaj</TableCell>
              <TableCell>İşlem</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {logs.map((log) => (
              <TableRow key={log.id}>
                <TableCell>{log.time}</TableCell>
                <TableCell>{log.ip}</TableCell>
                <TableCell>{log.level}</TableCell>
                <TableCell>{log.message}</TableCell>
                <TableCell>
                  <Button variant="text" size="small">
                    İncele
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* Sayfalama */}
      <Box display="flex" justifyContent="center" alignItems="center" mt={2}>
        <Button variant="outlined" sx={{ mr: 2 }}>Önceki</Button>
        <Typography>Sayfa 1/5</Typography>
        <Button variant="outlined" sx={{ ml: 2 }}>Sonraki</Button>
      </Box>
    </Box>
  );
}

export default LogsPage;
